int ListActivity::rowCount(const QModelIndex &parent) const
{
    Q_UNUSED(parent);
    return m_restaurantList.count();
}
QVariant ListActivity::data(const QModelIndex &index, int role) const
{

    int nRow = index.row();
    if (nRow < 0)
        return QVariant();
    const FOOD_BOOK_ITEM &item = m_restaurantList[index.row()];
    switch (static_cast<ColumnNames>(role))
    {
    case ColumnNames::name:
        return  item.Name;
    case ColumnNames::add:
        return item.add;
    case ColumnNames::phone:
        return item.phone;
    case ColumnNames::opentime:
        return item.opentime;
    case ColumnNames::symbolCode:
        return item.symbolCode;
    case ColumnNames::subSymbol:
        return item.subSymbol;
    }
    return "";

}
QHash<int, QByteArray> ListActivity::roleNames() const
{
    QHash<int, QByteArray> roles;
    qDebug()<<" QHash<int, QByteArray> roles;"<<roles;
    roles[static_cast<int>(ColumnNames::name)] = "name_qml";
    roles[static_cast<int>(ColumnNames::add)] = "address_qml";
    roles[static_cast<int>(ColumnNames::phone)] = "phone_qml";
    roles[static_cast<int>(ColumnNames::opentime)] = "opentime_qml";
    roles[static_cast<int>(ColumnNames::symbolCode)] = "symbolCode_qml";
    roles[static_cast<int>(ColumnNames::subSymbol)] = "subSymbol_qml";
    return roles;
}
int ListActivity::getIndexNumber() const
{
    return rowCount();
}
void ListActivity::setRestaurantList(QList<FOOD_BOOK_ITEM>&restaurantList)
{
    m_restaurantList = restaurantList;
    emit changeIndexNumber();
}
QList<FOOD_BOOK_ITEM> ListActivity::sendParsedData () const
{
    return m_restaurantList;
}


